import React from 'react';

function ProductList({ onAddToCart }) {
  const products = [
    { id: 1, nama: 'Beras Premium', harga: 12000, jumlah: 1 },
    { id: 2, nama: 'Beras Organik', harga: 15000, jumlah: 1 },
    { id: 3, nama: 'Beras Super', harga: 10000, jumlah: 1 },
  ];

  return (
    <div>
      {products.map((product) => (
        <div key={product.id}>
          <h3>{product.nama}</h3>
          <p>Harga: Rp {product.harga}</p>
          <button onClick={() => onAddToCart(product)}>Add to Cart</button>
        </div>
      ))}
    </div>
  );
}

export default ProductList;
